function AppSafari(){var hunters=[];function generateLight(targeted_hunter){let u=null;for(;null===u;)u=getRandomInt(safariLights.length);targeted_hunter.setItem(safariLights[u]),targeted_hunter.setItem(safariItems[7])}this.getHunters=function getHunters(){return hunters},this.setHunter=function setHunter(name){var hunter=new Hunter;hunter.setName(name),generateLight(hunter),hunters.push(hunter)},this.setHunterLight=function setHunterLight(name){var hunter=new Hunter;hunter.setName(name);let u=null;for(;null===u;)u=getRandomInt(safariLights.length);hunter.setItem(safariLights[u]),hunters.push(hunter)},this.setHunterPhoto=function setHunterPhoto(name){var hunter=new Hunter;hunter.setName(name),hunter.setItem(safariItems[7]),hunters.push(hunter)},this.getHunterById=function getHunterById(id){return hunters[id]},this.reset=function reset(){hunters=[]},this.generateItem=function generateItem(targeted_hunter){if(targeted_hunter.getItems().length>=7)throwError("Limit of items by players is reached.");else for(let i=0;i<1;i++){let u=null;for(;null===u;)u=getRandomInt(safariItems.length);let v=0;if(hunters.length>0&&hunters.forEach(hunter=>{hunter.getItems().forEach(item=>{item[0]==items[u][0]&&v++})}),v<items[u][1]&&!targeted_hunter.getItems().includes(items[u]))return targeted_hunter.setItem(safariItems[u]),!0;i--}}}